INSERT INTO `service1` VALUES (1,'2015-08-10 09:28:59','2015-08-10 09:29:01','Beauty','',NULL,'0','',NULL,NULL,30,0,1,1,''),(2,'2015-08-10 09:28:59','2015-08-10 09:29:16','Health Care',NULL,'1','1',NULL,NULL,'nbdimages/mobile/doctor.png',2,1,0,1,''),(3,'2015-08-10 09:28:59','2015-08-10 09:29:16','Doctor','','1','158ff822-3af6-4b60-95a9-202c7e73eaae','doctorOrder','  <img  src=\"nbdimages/images/img-1.jpg\" alt=\"doctor image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We guarantee Best Doctors and Specialists at your location</h3><p class = \"textContentId1\"> No more waiting for long hours in Clinics  </p><p class = \"textContentId2\">   No more wasting time in Traffic </p>                 <p class = \"textContentId3\">  No more ignoring of your health for time, company confusion. </p>','nbdimages/mobile/healthcare.png',10,0,0,1,''),(4,'2015-08-10 09:28:59','2015-08-10 09:29:16','Electrician','','2','1b867019-e781-4726-930d-e3a44dbb6fac','pageServices','  <img  src=\"nbdimages/images/electrician-1.jpg\" alt=\"electrician image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Is Electricity issue? Non functioning gadgets? Do not worry about it. We are here to fix these issues.</h3><p class = \"textContentId1\"> 100% Safety Guaranteed, Free Service if the problem recurs  </p><p class = \"textContentId2\">   Qualified & Trained Engineers </p>                 <p class = \"textContentId3\">  Trained staff in repairing household electrical points, fans, lights, wiring problem, short circuit issues etc. </p> <p class = \"textContentId4\">  Specialized engineers in branded & local large appliances like Geysers, Air Conditioners, Television, Refrigerators, Washing Machines </p>','nbdimages/mobile/mob_electrician.png',16,0,0,1,''),(5,'2015-08-10 09:28:59','2015-08-10 09:29:16','Up Keeping',NULL,'2','2',NULL,NULL,'nbdimages/mobile/upkeeping.png',12,1,0,1,''),(6,'2015-08-10 09:28:59','2015-08-10 09:29:16','PhysioTherapy','','1','21db609d-8a05-4a05-9f6d-4ef37e875ea8','pageServices',' <img  src=\"nbdimages/images/physiotheraphy.png\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Injury? Pain? Arthritis? Surgery? and still being asked to travel to your physiotherapist.</h3><p class = \"textContentId1\"> Auro brings physiotherapy services at your doorstep  </p><p class = \"textContentId2\">   All physiotherapists use latest techniques and devices </p>                 <p class = \"textContentId3\">  100% certified with a masters degree in physiotherapy </p> <p class = \"textContentId4\">  Average experience more than 5 years </p>','nbdimages/mobile/physiotherapy.png',2,0,0,1,''),(7,'2015-08-10 09:28:59','2015-08-10 09:29:16','Home Care Taker','','1','29d5b0e3-b3b0-4e43-8840-808750518242','pageServices','<img  src=\"nbdimages/images/homecare-1.jpg\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Nursing is not just about health care, it is about caring. A little compassion, care helps healing. Auro brings to you the best nursing at home.</h3><p class = \"textContentId1\"> Fully certified senior nurse & home care services.  </p><p class = \"textContentId2\">   Qualified nurses in handling post surgery care, oxygen administration, injection, tracheostomy, wound care, suture removal, infusions etc. </p>                 <p class = \"textContentId3\">  Hourly/daily/weekly/monthly package. </p> <p class = \"textContentId4\">  Nurses trained in English and other languages. </p>','nbdimages/mobile/upcoming.png',8,0,0,1,''),(8,'2015-08-10 09:28:59','2015-08-10 09:29:16','Coming Soon',NULL,NULL,'3',NULL,NULL,'',28,1,0,1,''),(9,'2015-08-10 09:28:59','2015-08-10 09:29:16','Pet Care','','2','5f0415dd-7e67-4d2c-bdb8-6a5b58c4f94e','pageServices',' <img  src=\"nbdimages/images/petcare.png\" alt=\"petcare image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We all love our dogs. And who would not like to send them to school to be the smartest kid around. No need now we have a better solution for you now.</h3><p class = \"textContentId1\"> Get your pet groomed in your home from Aurodog groomers  </p><p class = \"textContentId2\"> Excellent experience of more than 5 years </p>                 <p class = \"textContentId3\">  Trained in making your dog, listen to you, caring loving and protective. </p> <p class = \"textContentId4\">  So what are you waiting for? Go ahead and pamper your pet. </p>','nbdimages/mobile/petcare.png',24,0,0,1,''),(10,'2015-08-10 09:28:59','2015-08-10 09:29:16','Pathology','','1','687a7dae-464f-43a0-a617-4f93a986949f','pathologyOrder','<img  src=\"nbdimages/images/pathalogy-1.png\" alt=\"pathology image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">We will not let you waste your valued time in Labs, traffic posts and make multiple rounds of visits for collection of reports</h3><p class = \"textContentId1\"> Auro brings to you At Home Pathology Tests.  </p><p class = \"textContentId2\">   Now you can get your samples collected at the comfort of your home/office </p>                 <p class = \"textContentId3\">  NABL Certified Laboratories </p> <p class = \"textContentId4\">  Get test reports emailed to you right away </p><p class = \"textContentId5\">  Hard copies of test reports are couriered </p>','nbdimages/mobile/pathology.png',4,0,0,1,''),(11,'2015-08-10 09:28:59','2015-08-10 09:29:16','Nursing Care','','1','6aac2225-8b45-4df7-8875-f712c07f2d49','pageServices',' <img  src=\"nbdimages/images/nursing-1.png\" alt=\"nursing image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Nursing is not just about health care, it is about caring. A little compassion, care helps healing. Auro brings to you the best nursing at home.</h3><p class = \"textContentId1\"> Fully certified senior nurse & home care services.  </p><p class = \"textContentId2\">   Qualified nurses in handling post surgery care, oxygen administration, injection, tracheostomy, wound care, suture removal, infusions etc. </p>                 <p class = \"textContentId3\">  Hourly/daily/weekly/monthly package. </p> <p class = \"textContentId4\">  Nurses trained in English and other languages. </p>','nbdimages/mobile/nurse.png',6,0,0,1,''),(12,'2015-08-10 09:28:59','2015-08-10 09:29:16','Pest Control','','2','730fbb84-7784-4369-bf8d-2dfcfe1c4cab','pageServices','  <img  src=\"nbdimages/images/pestcontroller-1+.jpg\" alt=\"painter image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Be safe at home with your family not with pests. Auro brings the latest pest control solutions right at your doorstep.</h3><p class = \"textContentId1\"> Effective,long lasting herbal solutions  </p><p class = \"textContentId2\"> Money back guarantee if problem recurs in a week </p>                 <p class = \"textContentId3\">  Service guaranteed at the time of your convenience </p>','nbdimages/mobile/pestcontrol.png',22,0,0,1,''),(13,'2015-08-10 09:28:59','2015-08-10 09:29:16','Carpentry','','2','80c1bbf0-f570-4604-a795-818076dd87e5','pageServices',' <img  src=\"nbdimages/images/Carpenter-1.png\" alt=\"nursing image\" class=\"img-responsive imageName\" />               <h3 class = \"textContentId\"> Planning for a grand Pooja room? Or a wood cabinet?</h3>                 <p class = \"textContentId1\"> Auro provides you best carpenters from Rajasthan.  </p>                 <p class = \"textContentId2\">   More than 12 years of experience and finishing is best of the kind. </p>                 <p class = \"textContentId3\">  100% satisfaction guarantee </p>','nbdimages/mobile/homecaretaker.png',14,0,0,1,''),(14,'2015-08-10 09:28:59','2015-08-10 09:29:16','Plumber','','2','a6c15070-aee6-40b9-bed6-48c844d86e18','pageServices','  <img  src=\"nbdimages/images/plumber.jpg\" alt=\"plumber image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Leaking pipes, water logged drains and improper sanitary fittings causes a havoc. Meet our Auro Plumbers!</h3><p class = \"textContentId1\"> Quick and fast service guaranteed  </p><p class = \"textContentId2\"> Auro plumbers have an average experience of more than 20 years in plumbing </p>                 <p class = \"textContentId3\"> Trained in handling well known brands in sanitary ware which includes Jaguar, Cera, Hindware, Parryware, Kohler. </p>','nbdimages/mobile/plumber.png',26,0,0,1,''),(15,'2015-08-10 09:28:59','2015-08-10 09:29:16','Painter','','2','dd8d1e0f-cbe3-44ff-9cbc-1497e1680437','pageServices','  <img  src=\"nbdimages/images/painter-1.png\" alt=\"painter image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Want to convert a house into a home? Bored of old paint on the wall, exterior? Want to decorate your kids room?</h3><p class = \"textContentId1\"> Auro serves you with the best professionals to your residential and commercial complexes.  </p><p class = \"textContentId2\"> We provide painting services like wall painting, interior, exterior painting, wall decoration. </p>                 <p class = \"textContentId3\">  The average experience of painters is more than 5 years. </p> <p class = \"textContentId4\">  High quality work at affordable prices. </p>','nbdimages/mobile/painter.png',20,0,0,1,''),(16,'2015-08-10 09:28:59','2015-08-10 09:29:16','Fabrication(Iron or Alluminium)','','2','f6e225dd-f7e1-4d68-a476-b885e37caf33','pageServices','  <img  src=\"nbdimages/images/fabrication-1.png\" alt=\"fabrication image\" class=\"img-responsive imageName\" /> \n<h3 class = \"textContentId\">Intricate furniture, beautiful painting, And old fashioned windows and fences</h3><p class = \"textContentId1\"> We have one stop solution for all you Fabrication needs - piping, rolling, sliding Gate, safety grills, window grills  </p><p class = \"textContentId2\">  Average experience of engineer more than 8 years </p>                 <p class = \"textContentId3\">  High quality finishing at affordable prices </p> ','nbdimages/mobile/fabrication.png',18,0,0,1,'');
